import unittest

import config_modules
config_modules.add()
from aplication.usecases.process_algorithm_files import process_algorithm_files

class ProcessAlgorithmFilesShoud(unittest.TestCase):
    def setUp(self):
        self.good_body = {
                    "file_1": { 
                            "name": "Nico", 
                            "file_content": "data:application/vnd.openxmlformats-officedocument.spreadsheetml.sheet;base64,"
                            },
                    "file_2": { 
                            "name": "No Nico", 
                            "file_content": "data:application/vnd.openxmlformats-officedocument.spreadsheetml.sheet;base64,"
                            }
                    }
        self.bad_body = {
                    "file_1": { 
                            "name": "Nico", 
                            "file_content": "data:application/vnd.openxmlformats-officedocument.spreadsheetml.sheet;base64,"
                            },
                    "file_2": { 
                            "name": "No Nico", 
                            "file_content": "data:application/vnd.openxmlformats-"
                            }
                    }

    def test_process_good_files(self) -> None:
        process_files = process_algorithm_files(self.good_body)
        self.assertEqual(type(process_files), dict)

    def test_no_algorithm_in(self) -> None:
       self.assertRaises(ValueError, process_algorithm_files, self.bad_body)



if __name__ == '__main__':
    unittest.main()